import { Text, View, FlatList } from 'react-native'
import users from '../data/users'

export default function UserList() {

    function getUserItem({ item: user}) {
    return <Text>{user.name}</Text>
    }

    return (
        <View>
            <FlatList
                keyExtractor={user => user.id.toString()}
                data={users}
            />
        </View>
    )
}
